            background-attachment: fixed;
            background-position: center;
            background-size: cover;
            animation: fade-in 3s ease;
            overflow: hidden;
        }
        @keyframes fade-in
        {
            from {
                opacity: 0;
                background-color: #fff;
                transform: translateY(-3%);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }
        #container {
            height: 100vh;
            width: 100%;
            position: relative;
            display: flex;
            align-items: center;
        }
        #info-list {
            position: fixed;
            top: 0;
            left: 0;
            bottom: 0;
            padding: 16px 10px;
            display: flex;
            flex-direction: column;
            bottom: 1rem;
        }
        #nav-icon {
            cursor: pointer;
        }
        #nav-icon:hover .icon-line{
            background-color: #fff;
        }
        .icon-line {
            height: 3px;
            width: 2rem;
            background-color: #ddd;
        }
        .icon-line:nth-child(2) {
            margin: 7px 0;
        }
        #forbidden-div {
            position: relative;
            height: 400px;
            width: 60%;
            background-color: #000;
            margin: 0 auto;
            display: flex;
            justify-content: center;
            align-items: center;
            flex-direction: column;
            text-align: center;
            padding: 20px;
        }
        #forbidden-div::before, .card::before {
            content: '';
            position: absolute;
            top: -4px;
            left: -4px;
            bottom: -4px;
            right: -4px;
            z-index: -1;
        }
        #forbidden-div img {
            width: 250px;
        }
        .card::before, .card::after {
            background: linear-gradient(235deg, #e100ff, #060c21, #3700ff);
        }
        #forbidden-div::before, #forbidden-div::after {
            background: rgb(199, 199, 18);
        }
        #forbidden-div::after, .card::after {
            content: '';
            position: absolute;
            bottom: -5px;
            top: -5px;
            left: -5px;
            right: -5px;
            right: -5px;
            z-index: -2;
            filter: blur(50px);
        }
        .border-line {
            position: absolute;
            background: ghostwhite;
        }
        .line-top {
            top: -4px;
            height: 4px;
            animation: move-top 1.5s infinite;
        }
        .line-bottom {
            bottom: -4px;
            height: 4px;
            animation: move-bottom 1.5s infinite;
        }
        .line-left {
            left: -4px;
            width: 4px;
            animation: move-left 1.5s infinite;
        }
        .line-right {
            right: -4px;
            width: 4px;
            animation: move-right 1.5s infinite;
        }
        .img-container img{
            max-width: 200px;
            height: auto;
            border-radius: 50%;
        }
        h1 {
            color: #fff;
            font-size: 40px;
            margin: 1.5rem 0;
            font-weight: bold;
            text-transform: uppercase;
        }
        h4 {
            color: #fff;
            margin: 1.5rem 0;
            font-size: 30px;
        }
        @keyframes move-top {
            0% {
                left: 0;
                width: 0;
            }
            40% {
                width: 20%;
            }
            100% {
                left: 100%;
                width: 0;
            }
        }
        @keyframes move-bottom {    
            0% {
                right: 0;
                width: 0;
            }
            40% {
                width: 20%;
            }
            100% {
                right: 100%;
                width: 0;
            }
        }
        @keyframes move-left {    
            0% {
                bottom: 0;
                height: 0;
            }
            40% {
                height: 20%;
            }
            100% {
                bottom: 100%;
                height: 0;
            }
        }
        @keyframes move-right {    
            0% {
                top: 0;
                height: 0;
            }
            40% {
                height: 20%;
            }
            100% {
                top: 100%;
                height: 0;
            }
        }

            background-attachment: fixed;
            background-position: center;
            background-size: cover;
            transform: translateX(-100%);
            transition: 1s ease;
            display: flex;
            justify-content: center;
            align-items: center;
        }
        #close-icon {
            position: absolute;
            top: 0;
            right: 10px;
            font-size: 3rem;
            color: #fff;
        }
        #card-section {
            display: flex;
            flex-direction: column;
            text-align: center;
        }
        #card-container {
            margin-top: 1rem;
            display: flex;
            justify-content: center;
            align-items: center;
            justify-content: space-around;
        }
        .card {
            background-color: #fff;
            margin: 0 3rem;
            flex-basis: 18%;
            transition: 0.5s ease;
            position: relative;
        }
        .card:hover {
            background: linear-gradient(235deg, #e100ff, #060c21, #3700ff);
            animation: shake 0.5s;
        }
        @keyframes shake{
            0% {
                transform: rotate(3deg);
            }
            25% {
                transform: rotate(-3deg);
            }
            50% {
                transform: rotate(3deg);
            }
            75% {
                transform: rotate(-3deg);
            }
            100% {
                transform: rotate(0);
            }
        }
        .card-image {
            width: 250px;
            height: 250px;
            overflow: hidden;
            position: relative;
        }
        .card-image:hover .card-layer {
            opacity: 0.5;
        }
        .card-layer {
            position: absolute;
            top: 0;
            right: 0;
            left: 0;
            bottom: 0;
            background-color: #fff;
            opacity: 0;
            transition: 0.3s ease;
        }
        .card-link {
            position: absolute;
            z-index: 3;
            opacity: 0;
            top: 0;
            right: 0;
            left: 0;
            bottom: 0;
            transition: 0.3s ease;
            display: flex;
            justify-content: center;
            align-items: center;
        }
        .card-button {
            padding: 10px 25px;
            background-color: #3700ff;
            border-radius: 10px;
            color: #fff;
            border: solid 1px #3700ff;
            transition: 0.3s ease;
        }
        .card-button:hover {
            background-color: #fff;
            color: #3700ff;

        }
        .card-image:hover .card-link {
            opacity: 1;
        }
        .card-image img {
            width: 100%;
            height: auto;
            object-fit: cover;
        }
        .card-info {
            padding: 20px;
            text-align: center;
        }
        .card:hover .card-info p{
            color: #fff;
        }
        .card-info p:first-child {
            margin-bottom: 1rem;
        }
    </style>
</head>
